import React, { useState } from 'react';
import './Profile.css';

function Profile(props) {
    // Assuming there is only one user in the array for simplicity
    const [user, setUser] = useState({
        username: "John Do",
        deadlift: "300",
        squat: "250",
        ohp: "120",
        bench: "200",
        friend: "true"
    });
    const [isEditing, setIsEditing] = useState({
        username: false,
        deadlift: false,
        squat: false,
        ohp: false,
        bench: false
    });

    // Function to handle field changes
    const handleChange = (field, value) => {
        setUser(prev => ({ ...prev, [field]: value }));
    };

    // Function to toggle editing state
    const toggleEdit = (field) => {
        setIsEditing(prev => ({ ...prev, [field]: !prev[field] }));
    };

    return (
        <div className="display-container mt-40 d-flex">
            <div className="row">
                <div className="col-md-6 d-flex flex-column align-items-center justify-content-center">
                    <div className="profile-image-container">
                        <img src="/profile.png" alt="Profile" className="profile-img mb-3" />
                    </div>
                    {isEditing.username ? (
                        <input
                            type="text"
                            value={user.username}
                            onChange={(e) => handleChange('username', e.target.value)}
                            onBlur={() => toggleEdit('username')}
                            className="username-input"
                            autoFocus
                        />
                    ) : (
                        <div className="username" onClick={() => toggleEdit('username')}>{user.username}</div>
                    )}
                </div>
                <div className="col-md-6 d-flex flex-column justify-content-center align-items-center">
                    <div className="vr" style={{ height: '100%' }}></div>
                    <div className="right-content d-flex flex-column align-items-center">
                        <div className="row mb-3">
                            <div className="col">
                                <table className="table">
                                    <thead>
                                        <tr>
                                            <th>Deadlift</th>
                                            <td>{editableField('deadlift')}</td>
                                        </tr>
                                    </thead>
                                </table>
                            </div>
                            <div className="col">
                                <table className="table">
                                    <thead>
                                        <tr>
                                            <th>Squat</th>
                                            <td>{editableField('squat')}</td>
                                        </tr>
                                    </thead>
                                </table>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col">
                                <table className="table">
                                    <thead>
                                        <tr>
                                            <th>OHP</th>
                                            <td>{editableField('ohp')}</td>
                                        </tr>
                                    </thead>
                                </table>
                            </div>
                            <div className="col">
                                <table className="table">
                                    <thead>
                                        <tr>
                                            <th>Bench</th>
                                            <td>{editableField('bench')}</td>
                                        </tr>
                                    </thead>
                                </table>
                            </div>
                        </div>
                        <button className="btn btn-primary login">Day 1 - Push</button>
                    </div>
                </div>
            </div>
        </div>
    );

    function editableField(field) {
        return isEditing[field] ? (
            <input
                type="text"
                value={user[field]}
                onChange={(e) => handleChange(field, e.target.value)}
                onBlur={() => toggleEdit(field)}
                className="exercise-input"
                autoFocus
            />
        ) : (
            <span onClick={() => toggleEdit(field)}>{user[field]} kg</span>
        );
    }
}

export default Profile;
